Contenido:
Proyectos de leyes: (Concordato)

a) Proyecto de ley que reconoce la personalidad jurídica a varias instituciones y asociaciones religiosas constituidas según el derecho canónico;
b) Proyecto de ley que modifica el artículo 14 de la Ley No. 1520 sobre el Servicio Militar Obligatorio;
c) Proyecto de ley que modifica los artículos 258 y 259 del Código Penal y el artículo 80 del Código de Procedimiento Criminal;
d) Proyecto de ley que modifica varios artículos correspondientes al título IV de la Ley No. 659 sobre Actos del Estado Civil;
e) Proyecto de ley que modifica el artículo 1° de la Ley de Divorcio;
f) Proyecto de ley que unifica y amplía las disposiciones legales sobre días festivos, conmemorativos y de duelo; 
g) Proyecto de ley que agrega un párrafo al artículo 2 de la Ley No. 1804 sobre Suscripciones Públicas; 
h) Proyecto de ley sobre exoneraciones y franquicia postal y telegráficas;
i) Proyecto de ley que modifica la ley de Educación;
j) Proyecto de ley que instituye la separación personal.
